import React, { useState, useEffect } from "react";

const Home = () => {
  const [list, setList] = useState([]);

  useEffect(() => {
    getLists.value();
  }, []);

  const getLists = async () => {
    let result = fetch("http://localhost:5000/details");
    result = await result.json();
    setList(result);
  };
  console.warn("list", list);

  return (
    <div className="">
      <h3>STUDENT-LIST</h3>
    </div>
  );
};
export default Home;
